import React from 'react';
import AppLayOut from "../components/AppLayOut"
import Head from 'next/head'

const Profile = () => {

  const followerList = [{nickname : 'sook'},{nickname : 'princess'},{nickname : 'coding genius'}];
  const followingList = [{nickname : 'sook'},{nickname : 'princess'},{nickname : 'coding genius'}];

  return (
  <>
    <Head>
        <title>내 프로필 - NodeBird</title>
    </Head>
    <AppLayOut>
      <NicknameEditForm/>
      <FollowList header = '팔로잉 목록'data = {followingList}/>
      <FllowList header = '팔로워 목록' data = {followerList}/>
    </AppLayOut>
    </>
  )
}

export default Profile;
